function commitCountInit() {
	module('server.nodejs.WebInterface').load(true);
	var server = this.createCmdLineServerInterface(),
		repoURL = this.getMorphNamed('repoURLMorph').textString,
		from = this.getMorphNamed('fromRev').textString,
		to = this.getMorphNamed('toRev').textString,
		arg = '-r' + from + ':' + to,
		cmd = 'svn log ' + repoURL + ' ' + arg;
	connect(server, 'result', this, 'commitCountResult', {
		converter: function(result) { return this.targetObj.convertRawResultToRevInfos(result) }
	});
	server.runCommand(cmd)
	var list = this.getMorphNamed('commitCountList').updateList(['loading']);
}

