function commitCountResult(revInfos) {
	var list = this.getMorphNamed('commitCountList'),
		users = {};
	revInfos.forEach(function(ea) { if (!users[ea.name]) users[ea.name] = 0; users[ea.name]++ })

        var name = this.get('userName').textString;
        var userRevInfos = revInfos
            .select(function(ea){return ea.name == name})
        var userRevs = userRevInfos.pluck('rev')

        var server = this.createCmdLineServerInterface();
        repoURL = this.getMorphNamed('repoURLMorph').textString
        connect(server, 'result', this, 'showRevs');
        var revs = userRevs.collect(function(ea) { return ' -r '+ ea}).join('')
        server.runCommand('svn log ' +repoURL + ' -q -v ' + revs)

	var items = Properties.own(users)
		.sortBy(function(name) { return users[name] })
		.collect(function(name) { return name + ': ' + users[name]})
		.reverse(true);
	list.updateList(items)
}

