function convertRawResultToRevInfos(result) {
	if (!result) return [];
	if (result.stderr !== '') {
		alert(result.stderr);
		return [];
	}
	var str = result.stdout;
		lines = str.split('\n'),
		revInfos = [];
	for (var i = 0; i < lines.length; i++) {
		var line = lines[i],
			match = line.match(/r([0-9]+) \| ([^\s]+) \| ([0-9-]+) ([0-9a-zA-Z\s:\+\,\(\)]+)/);
		if (!match) continue;
		var revInfo = {rev: Number(match[1]), name: match[2], date: match[3], time: match[4]};
		revInfos.push(revInfo);
	}
	return revInfos;
}

