function showRevs(serverResult) {

    var string = serverResult.stdout
        .replace(/----+\n/g, "")
        .replace(/Changed paths\:\n/g, "")


    var rev = null
    var files = {};
    Strings.lines(string).forEach(function(ea) {
        if (ea.startsWith("r"))
            rev = ea;
        else {
            var m = ea.match(/   ([RADM]) (.*)/)
            if (!m) {
                // alert("could not parse: " + ea); 
                return}
            var path = m[2]
            if (! files[path]) files[path] = [];
            files[path].push({action: m[1], string: rev});
        }
    })


    this.get('RevInfos').textString = Properties.own(files)
        .sortBy(function(ea) {
            return files[ea].length
        })
        .reverse()
        .collect(function(ea){
            return files[ea].length + ' ' + ea + ''
        }).join('\n')

}
